@bigbezet I'm sorry but the latency problem is not a hardware limitation only. Two things causes the latency : the driver's latency (the delay between which one touches the screen and the information is transmitted to the application) and the time needed by the OS to handle the information and make it appear on the screen (and this part is the longest one).
This video is pointless, one must compare like with like.

P.s.: english is not my native language, I hope what I say was clear enough.

@rEVOLution245  The screen's refresh rate has no relevance to its polling rate. Similarly, there are mice around (ex: Logitech G9) that poll 1000 times per second, but the screen doesn't need to be refreshed more than 60 times a second. 

In other words, the polling rate would be handled by dedicated hardware chips and never touch the tablet's operating system. The chips would report the position of the finger 60 times per second. 

Of course, this is at least 10 years away. If not more.

